                }
            },
        )

    /**
     * Get remote battery state (battery plugin)
     */
    override fun `getRemoteBattery`(): FfiBatteryState? =
        FfiConverterOptionalTypeFfiBatteryState.lift(
            callWithPointer {
                uniffiRustCall { _status ->
                    UniffiLib.INSTANCE.uniffi_cosmic_connect_core_fn_method_pluginmanager_get_remote_battery(it, _status)
                }
