        )

    /**
     * Check if a plugin is registered
     */
    override fun `hasPlugin`(`pluginName`: kotlin.String): kotlin.Boolean =
        FfiConverterBoolean.lift(
            callWithPointer {
                uniffiRustCall { _status ->
                    UniffiLib.INSTANCE.uniffi_cosmic_connect_core_fn_method_pluginmanager_has_plugin(
                        it,
                        FfiConverterString.lower(`pluginName`),
                        _status,
                    )
                }
            },
        )

    /**
     * Get list of registered plugin names
     */
    override fun `pluginNames`(): List<kotlin.String> =
        FfiConverterSequenceString.lift(
            callWithPointer {
                uniffiRustCall { _status ->
                    UniffiLib.INSTANCE.uniffi_cosmic_connect_core_fn_method_pluginmanager_plugin_names(it, _status)
                }
            },
        )

    /**
     * Register a plugin by name
     *
     * # Arguments
     *
     * * `plugin_name` - Plugin name: "ping", "battery", etc.
     */
    @Throws(ProtocolException::class)
    override fun `registerPlugin`(`pluginName`: kotlin.String) =
        callWithPointer {
            uniffiRustCallWithError(ProtocolException) { _status ->
                UniffiLib.INSTANCE.uniffi_cosmic_connect_core_fn_method_pluginmanager_register_plugin(
                    it,
                    FfiConverterString.lower(`pluginName`),
                    _status,
                )
            }
        }

    /**
     * Route a packet to the appropriate plugin
     */
    @Throws(ProtocolException::class)
    override fun `routePacket`(`packet`: FfiPacket) =
