public object FfiConverterTypePluginManager : FfiConverter<PluginManager, Pointer> {
    override fun lower(value: PluginManager): Pointer = value.uniffiClonePointer()

    override fun lift(value: Pointer): PluginManager = PluginManager(value)

    override fun read(buf: ByteBuffer): PluginManager {
        // The Rust code always writes pointers as 8 bytes, and will
        // fail to compile if they don't fit.
        return lift(Pointer(buf.getLong()))
    }

    override fun allocationSize(value: PluginManager) = 8UL

    override fun write(
        value: PluginManager,
        buf: ByteBuffer,
    ) {
        // The Rust code always expects pointers written as 8 bytes,
        // and will fail to compile if they don't fit.
        buf.putLong(Pointer.nativeValue(lower(value)))
    }
}

