/**
 * Discovery event types
 */
sealed class DiscoveryEvent {
    data class DeviceFound(
        val `device`: FfiDeviceInfo,
    ) : DiscoveryEvent() {
        companion object
    }

    data class DeviceLost(
        val `deviceId`: kotlin.String,
    ) : DiscoveryEvent() {
        companion object
    }

    data class IdentityReceived(
        val `deviceId`: kotlin.String,
        val `packet`: FfiPacket,
    ) : DiscoveryEvent() {
        companion object
    }

    companion object
}

public object FfiConverterTypeDiscoveryEvent : FfiConverterRustBuffer<DiscoveryEvent> {
    override fun read(buf: ByteBuffer): DiscoveryEvent =
        when (buf.getInt()) {
            1 -> {
                DiscoveryEvent.DeviceFound(
                    FfiConverterTypeFfiDeviceInfo.read(buf),
                )
            }

            2 -> {
                DiscoveryEvent.DeviceLost(
                    FfiConverterString.read(buf),
                )
            }

            3 -> {
                DiscoveryEvent.IdentityReceived(
                    FfiConverterString.read(buf),
                    FfiConverterTypeFfiPacket.read(buf),
                )
            }

            else -> {
                throw RuntimeException("invalid enum value, something is very wrong!!")
            }
        }

    override fun allocationSize(value: DiscoveryEvent) =
        when (value) {
            is DiscoveryEvent.DeviceFound -> {
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                (
                    4UL +
                        FfiConverterTypeFfiDeviceInfo.allocationSize(value.`device`)
                )
            }

            is DiscoveryEvent.DeviceLost -> {
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                (
                    4UL +
                        FfiConverterString.allocationSize(value.`deviceId`)
                )
            }

            is DiscoveryEvent.IdentityReceived -> {
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                (
                    4UL +
                        FfiConverterString.allocationSize(value.`deviceId`) +
                        FfiConverterTypeFfiPacket.allocationSize(value.`packet`)
                )
            }
        }

    override fun write(
        value: DiscoveryEvent,
        buf: ByteBuffer,
    ) {
        when (value) {
            is DiscoveryEvent.DeviceFound -> {
                buf.putInt(1)
                FfiConverterTypeFfiDeviceInfo.write(value.`device`, buf)
                Unit
            }

            is DiscoveryEvent.DeviceLost -> {
                buf.putInt(2)
                FfiConverterString.write(value.`deviceId`, buf)
                Unit
            }

            is DiscoveryEvent.IdentityReceived -> {
                buf.putInt(3)
                FfiConverterString.write(value.`deviceId`, buf)
                FfiConverterTypeFfiPacket.write(value.`packet`, buf)
                Unit
            }
        }.let { /* this makes the `when` an expression, which ensures it is exhaustive */ }
    }
}

